import styled from 'styled-components'

export const Label = styled.label`
    font-weight: 500;
    width: auto;
    font-size: 14px;
    padding-right: 5px;
`
export const Span = styled.label`
    font-weight: 500;
    width: auto;
    font-size: 14px;
    color: red;
    margin-right: 5px;
`
export const ContanierRadio = styled.div`
    display: flex;
    margin-left: 2px;
    margin-right: 2px;
    margin-bottom: 10px;
`
export const LabelLight = styled.label`
    font-weight: 200;
    font-size: 15px;
    margin-left: 5px;
    margin-right: 5px;
    cursor: pointer;
`
